import React from "react";
// import styledAnimals from './Animals.module.css'

export default class Animals extends React.Component {
  constructor(props) {
    super();
    const { animals } = props;
  }

  render() {
    return (
      <div>
        {animals.map((animal) => {
          console.log(animal);
        })}
      </div>
    );
  }
}
